import styled from "styled-components";

const MainContainer = styled.div`
  z-index: 99;
  height: calc(100vh-5rem) !important;
`;

function Main() {
  return (
    <MainContainer id="GlobalContainer">
      <span>Main Page</span>
    </MainContainer>
  );
}

export default Main;
